DROP TABLE IF EXISTS `persona_tratamiento`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `persona_tratamiento` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `paciente` int(11) NOT NULL,
  `empleado` int(11) DEFAULT NULL,
  `tratamiento` int(11) NOT NULL,
  `num_sesiones` int(11) NOT NULL,
  `costotratamiento` float NOT NULL,
  `fecha_venta` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `fecha_registro` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `cuotas` int(11) NOT NULL,
  `descuento` int(11) DEFAULT NULL,
  `sucursal` int(11) NOT NULL,
  `observaciones` text COLLATE utf8_bin,
  PRIMARY KEY (`id`),
  KEY `paciente` (`paciente`,`empleado`,`tratamiento`),
  KEY `fk_empleado_tratamiento` (`empleado`),
  KEY `fk_tratamineto_tratamiento` (`tratamiento`),
  KEY `descuento` (`descuento`),
  KEY `sucursal` (`sucursal`),
  CONSTRAINT `fk_empleado_tratamiento` FOREIGN KEY (`empleado`) REFERENCES `persona` (`id`),
  CONSTRAINT `fk_paciente_tratamiento2` FOREIGN KEY (`paciente`) REFERENCES `persona` (`id`),
  CONSTRAINT `fk_persona_tratamiento_descuento` FOREIGN KEY (`descuento`) REFERENCES `descuento` (`id`),
  CONSTRAINT `fk_tratamiento_tratamiento_sucursal` FOREIGN KEY (`sucursal`) REFERENCES `sucursal` (`id`),
  CONSTRAINT `fk_tratamineto_tratamiento` FOREIGN KEY (`tratamiento`) REFERENCES `tratamiento` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=463 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
